import React from "react";
import { Link } from "react-router-dom";

function Form(){

    return(
        <div>
            <Link to={"/home"}>Home</Link>
            <div>
                <h1>Create pokemon</h1>
                <form action="" method="post">
                    <label for="name">Nombre:</label>
                    <input type="text"></input>
                    <label for="hp">Life:</label>
                </form>
            </div>
        </div>
    )
}

export default Form;
